import styled from "styled-components/native";

export const ButtonDoctorContainer = styled.View`
  display: flex;
  flex-direction: row;
  justify-content: space-between;
  align-items: center;
  width: 220px;
  height: 44px;
  border-radius: 50px;
  background: #4C7ABB;
  border: none;
  text-align: center;
  &:hover {
    background: #b4b4b4;
  }
`;

export const TextButton = styled.Text`
  color: #fff;
  font-size: 22px;
  font-weight: bold;
  padding: 2px;
  font-weight: 500;
 text-align: center;
`;

export const ButtonImageIcon = styled.View`
display: flex;
width: 25px;
height: 25px;
padding: 20px;
`;
